INSERT INTO `consultas` VALUES (1,'VIATURA 24HRS','DESCRIÇÃO VIATURA',' select sum (r.VALOR_NOTIFICACAO) as VALOR_NOTIFICACAO		from     (SELECT  \'viatura\' as viatura       ,COUNT(1) *25    AS VALOR_NOTIFICACAO			from dbCENTRAL c	inner join VIEW_HISTORICO h on h.CD_CLIENTE = c.CD_CLIENTE		INNER JOIN VIATURA VTR ON VTR.CD_VIATURA = H.CD_VIATURA	where 1=1		and h.DT_RECEBIDO >= dateadd(day,datediff(day,1,GETDATE()),0) and  h.DT_RECEBIDO <= CURRENT_TIMESTAMP		AND  VTR.CD_VIATURA <> \'10014\'	and c.ID_CENTRAL<> \'0000\' and h.DT_VIATURA_NO_LOCAL <> \'\'		group by c.ID_CENTRAL ) as r','SQL','4750',15000,18000,'verde','10/03/2023, 11:11:00',0,'MONITORAMENTO','http://45.225.191.101:9090/anywhere/#vfs://Global/Notifica%C3%A7%C3%B5es/VTR%2024%20Horas.xview'),(2,'O.S ATRASO VAREJO','DESCRIÇÃO ORDEM DE SERVIÇO EM ATRASO SEGMENTO VAREJO','USE [902] declare @dtInicial datetime, @dtFinal datetime, @evento varchar(10), @csid varchar(10), @dtDiaMesAno date, @dtHora date, @tolerancia int, @rota varchar(30);set @dtInicial = CURRENT_TIMESTAMP -365 set @dtFinal = CURRENT_TIMESTAMP SELECT c.ID_CENTRAL as CONTA,c.FANTASIA,t.NM_COLABORADOR as ROTA_TECNICO_RESPONSAVEL,o.ID_ORDEM as NUM_OS,CASE WHEN o.FECHADO = 0 THEN \'ABERTO\'    WHEN o.FECHADO = 1 THEN \'FECHADO\'   WHEN o.FECHADO = 2 THEN \'EM EXECUÇÂO\'   WHEN o.FECHADO = 3 THEN \'EM PAUSA\'   WHEN o.FECHADO = 4 THEN \'AGUARDANDO FECHAMENTO\'END as _STATUS_O_S,case when o.FECHADO = 1 then \'FECHADO\'  else convert(varchar,DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)) end as VALOR_NOTIFICACAO ,O.ABERTURA AS DATA_OS_ABERTA,DAY(o.ABERTURA) DIA_OS_ABERTA,O.TEMPOEXECUCAOPREVISTO as PREVISAO_HORAS,o.DATAAGENDADA ,S.NM_DESCRICAO as SOLICITANTE,D.DESCRICAODEFEITO as DEFEITO,o.DEFEITO as DEFEITO_DESCRICAO,o.EXECUTADO as INFORMACOES_ADICIONAIS,GRUPO.NM_DESCRICAO as GRUPO,EMP.NM_RAZAO_SOCIAL EMPRESA,CASE		WHEN (EMP.NM_RAZAO_SOCIAL = \'CPR - CENTRAL DE PORTARIA REMOTA\' 		AND GRUPO.NM_DESCRICAO IN (\'NEW LINE - MATRIZ\', \'SEGZOOM\',\'CPR - CENTRAL DE PORTARIA REMO\')) THEN \'PORTARIA GO\' 		WHEN (EMP.NM_RAZAO_SOCIAL = \'BERÇÁRIO(PORTARIA REMOTA)\' AND GRUPO.NM_DESCRICAO IN (\'NEW LINE - MATRIZ\', \'SEGZOOM\',\'CPR - CENTRAL DE PORTARIA REMO\'))  		THEN \'BERCARIO GO\'		WHEN (EMP.NM_RAZAO_SOCIAL = \'BERÇÁRIO(PORTARIA REMOTA)\'AND GRUPO.NM_DESCRICAO IN (\'NEW LINE - ANAPOLIS\'))THEN \'BERCARIO ANA\' WHEN (EMP.NM_RAZAO_SOCIAL = \'CPR - CENTRAL DE PORTARIA REMOTA\' AND GRUPO.NM_DESCRICAO IN (\'NEW LINE - ANAPOLIS\')) 	THEN \'PORTARIA ANA\' WHEN (EMP.NM_RAZAO_SOCIAL = \'BERÇÁRIO(PORTARIA REMOTA)\' AND grupo.NM_DESCRICAO IN (\'NEW LINE - TAGUATINGA\', \'NEW LINE RIACHO FUNDO - DF\')) THEN \'BERCARIO DF\' WHEN (EMP.NM_RAZAO_SOCIAL = \'CPR - CENTRAL DE PORTARIA REMOTA\' 	AND grupo.NM_DESCRICAO IN (\'NEW LINE - TAGUATINGA\', \'NEW LINE RIACHO FUNDO - DF\')) THEN \'PORTARIA DF\' WHEN (EMP.NM_RAZAO_SOCIAL  IN(\'NEW LINE - BM ALARMES\',\'NEW LINE - DB COMERCIO\',\'NEW LINE - DL ALARMES\',\'CERCA SENSORIAL\') AND t.NM_COLABORADOR <> \'ROTA 507\') THEN \'VAREJO GO\'WHEN t.NM_COLABORADOR = \'ROTA 507\'	THEN \'CORPORATIVO\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'Metropol Segurança\') THEN \'METROPOL ANA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - TAGUATINGA NORTE\') THEN \'TAGUATINGA DF\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA DE GOIANIA\') THEN \'PREF-GOIANIA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA APARECIDA DE GOIANIA\') THEN \'PREF-APARECIDA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA DE MACAPA\',\'NEW LINE - MACAPA\') THEN \'MACAPA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'BANCO BRADESCO\') THEN \'BRADESCO\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'BANPARA\') THEN \'BANPARA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - BELEM\') THEN \'BELEM PA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'SESMA\') THEN \'SESMA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - MATRIZ\') THEN \'PREF-VIAMAO\'ELSE EMP.NM_RAZAO_SOCIAL END AS SEGMENTO from dbORDEM O INNER JOIN dbCENTRAL C on C.CD_CLIENTE = o.CD_CLIENTE LEFT JOIN COLABORADOR T on T.CD_COLABORADOR = O.ID_INSTALADOR LEFT JOIN OS_SOLICITANTE S on S.CD_OS_SOLICITANTE = o.CD_OS_SOLICITANTE LEFT JOIN OSDEFEITO D on D.IDOSDEFEITO = O.IDOSDEFEITO LEFT JOIN ROTA R on R.CD_ROTA = C.ID_ROTA LEFT JOIN dbBAIRRO BR on BR.ID_BAIRRO = C.ID_BAIRRO LEFT JOIN dbCIDADE CID on CID.ID_CIDADE = C.ID_CIDADE LEFT JOIN OSSOLUCAO SOLU on SOLU.IDOSSOLUCAO = O.IDOSSOLUCAO LEFT JOIN GRUPO_CLIENTE GRUPO on GRUPO.CD_GRUPO_CLIENTE = C.CD_GRUPO_CLIENTE LEFT JOIN EMPRESA EMP on EMP.CD_EMPRESA = C.ID_EMPRESA LEFT JOIN FORMA_PAGAMENTO PAG on PAG.CD_FORMA_PAGAMENTO = O.PAGAMENTO LEFT JOIN USUARIO U ON U.CD_COLABORADOR = T.CD_COLABORADOR WHERE 1 = 1 AND t.NM_COLABORADOR in ( \'ROTA 03 - ROMERSON\',\'ROTA 06 - MARIO SERGIO\',\'ROTA 07 - JOAO FILHO\',\'ROTA 08 - LEVI\',\'ROTA 09 - Rodrigo Vieira\',\'ROTA 12 - ATILA VINICIUS\',\'ROTA 13 - CFTV VAREJO\') and o.FECHADO <> \'1\' and o.IDOSDEFEITO <> \'1054\' ORDER BY DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)   desc','SQL','162',1000,2535,'verde','10/03/2023, 11:11:00',0,'VAREJO','http://45.225.191.101:9090/anywhere/#vfs://Global/Notifica%C3%A7%C3%B5es/OS%20Em%20Atraso%20Varejo%20.xview'),(3,'O.S ATRASO PORTARIA ','DESCRIÇÃO ORDEM DE SERVIÇO EM ATRASO SEGMENTO PORTARIA','USE [902] declare @dtInicial datetime, @dtFinal datetime, @evento varchar(10), @csid varchar(10), @dtDiaMesAno date, @dtHora date, @tolerancia int, @rota varchar(30);set @dtInicial = CURRENT_TIMESTAMP -365 set @dtFinal = CURRENT_TIMESTAMP SELECT c.ID_CENTRAL as CONTA,c.FANTASIA,t.NM_COLABORADOR as ROTA_TECNICO_RESPONSAVEL,o.ID_ORDEM as NUM_OS,CASE WHEN o.FECHADO = 0 THEN \'ABERTO\'    WHEN o.FECHADO = 1 THEN \'FECHADO\'   WHEN o.FECHADO = 2 THEN \'EM EXECUÇÂO\'   WHEN o.FECHADO = 3 THEN \'EM PAUSA\'   WHEN o.FECHADO = 4 THEN \'AGUARDANDO FECHAMENTO\'END as _STATUS_O_S,case when o.FECHADO = 1 then \'FECHADO\'  else convert(varchar,DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)) end as VALOR_NOTIFICACAO ,O.ABERTURA AS DATA_OS_ABERTA,DAY(o.ABERTURA) DIA_OS_ABERTA,O.TEMPOEXECUCAOPREVISTO as PREVISAO_HORAS,o.DATAAGENDADA ,S.NM_D