'BELEM PA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'SESMA\') THEN \'SESMA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - MATRIZ\') THEN \'PREF-VIAMAO\'ELSE EMP.NM_RAZAO_SOCIAL END AS SEGMENTO from dbORDEM O INNER JOIN dbCENTRAL C on C.CD_CLIENTE = o.CD_CLIENTE LEFT JOIN COLABORADOR T on T.CD_COLABORADOR = O.ID_INSTALADOR LEFT JOIN OS_SOLICITANTE S on S.CD_OS_SOLICITANTE = o.CD_OS_SOLICITANTE LEFT JOIN OSDEFEITO D on D.IDOSDEFEITO = O.IDOSDEFEITO LEFT JOIN ROTA R on R.CD_ROTA = C.ID_ROTA LEFT JOIN dbBAIRRO BR on BR.ID_BAIRRO = C.ID_BAIRRO LEFT JOIN dbCIDADE CID on CID.ID_CIDADE = C.ID_CIDADE LEFT JOIN OSSOLUCAO SOLU on SOLU.IDOSSOLUCAO = O.IDOSSOLUCAO LEFT JOIN GRUPO_CLIENTE GRUPO on GRUPO.CD_GRUPO_CLIENTE = C.CD_GRUPO_CLIENTE LEFT JOIN EMPRESA EMP on EMP.CD_EMPRESA = C.ID_EMPRESA LEFT JOIN FORMA_PAGAMENTO PAG on PAG.CD_FORMA_PAGAMENTO = O.PAGAMENTO LEFT JOIN USUARIO U ON U.CD_COLABORADOR = T.CD_COLABORADOR WHERE 1 = 1 AND t.NM_COLABORADOR  IN (\'CPR 01 - RONALDO DIAS\',\'CPR 02 - FABIANO NEVES\',\'CPR 03 – RENAN PEREIRA\',\'CPR 04– EDUARDO BESSA\' ,\'CPR 06 - DANYEL\',\'CPR 10 - JAMES\',\'CPR 12 - RUBIAN\',\'CPR 24H – JONE WESLEY\',\'CPR 24H – DAVI\',\'CPR DEPARTAMENTO TÉCNICO TRIAGEM\',\'CPR 09 – JHONNATHAN ROBERT\') and o.FECHADO <> \'1\' and o.IDOSDEFEITO <> \'1054\' ORDER BY DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)   desc','SQL','16',1000,2026,'verde','10/03/2023, 11:11:00',0,'PORTARIA','http://45.225.191.101:9090/anywhere/#vfs://Global/Notifica%C3%A7%C3%B5es/OS%20Em%20Atraso%20Portaria.xview'),(4,'CONTAS ATIVAS SIGMA','CONTAS ATIVAS SIGMA',' select count (*) as VALOR_NOTIFICACAO  from     (SELECT  C.ID_CENTRAL AS CONTA			,MAX(C.FANTASIA) AS FANTASIA			,MAX(c.DATAINST) AS DATA_HABILITACAO			,CONVERT(VARCHAR, MIN(C.DATAINST),3) AS DATA_DE_HABILITACAO			,MAX(C.ID_ESTADO) AS ESTADO			,MAX(CID.NOME) AS CIDADE			,MAX(BR.NOME) AS BAIRRO			,GRUPO.NM_DESCRICAO AS GRUPO			,EMP.NM_RAZAO_SOCIAL EMPRESA			FROM dbCENTRAL c		LEFT JOIN dbBAIRRO BR ON BR.ID_BAIRRO = C.ID_BAIRRO		LEFT JOIN dbCIDADE CID ON CID.ID_CIDADE = C.ID_CIDADE		LEFT JOIN GRUPO_CLIENTE GRUPO ON GRUPO.CD_GRUPO_CLIENTE = C.CD_GRUPO_CLIENTE		LEFT JOIN EMPRESA EMP ON EMP.CD_EMPRESA = C.ID_EMPRESA		LEFT JOIN COLABORADOR T on T.CD_COLABORADOR = C.CD_TECNICO_RESPONSAVEL		LEFT JOIN ROTA R on R.CD_ROTA = C.ID_ROTA		WHERE 1=1		AND C.FG_ATIVO = 1		AND C.CTRL_CENTRAL = 1  		GROUP BY C.ID_CENTRAL,GRUPO.nm_descricao, EMP.NM_RAZAO_SOCIAL) as r\n','SQL','5441',6000,7000,'verde','10/03/2023, 11:11:00',0,'DIRETORIA','http://45.225.191.101:9090/anywhere/#vfs://Global/Contas%20Ativas/Carteira%20Contas%20Ativas.xview'),(5,'CONTAS ATIVAS SANKHYA','CONTAS ATIVAS SANKHYA',' select count (*) as VALOR_NOTIFICACAO  from     (SELECT  C.ID_CENTRAL AS CONTA			,MAX(C.FANTASIA) AS FANTASIA			,MAX(c.DATAINST) AS DATA_HABILITACAO			,CONVERT(VARCHAR, MIN(C.DATAINST),3) AS DATA_DE_HABILITACAO			,MAX(C.ID_ESTADO) AS ESTADO			,MAX(CID.NOME) AS CIDADE			,MAX(BR.NOME) AS BAIRRO			,GRUPO.NM_DESCRICAO AS GRUPO			,EMP.NM_RAZAO_SOCIAL EMPRESA			FROM dbCENTRAL c		LEFT JOIN dbBAIRRO BR ON BR.ID_BAIRRO = C.ID_BAIRRO		LEFT JOIN dbCIDADE CID ON CID.ID_CIDADE = C.ID_CIDADE		LEFT JOIN GRUPO_CLIENTE GRUPO ON GRUPO.CD_GRUPO_CLIENTE = C.CD_GRUPO_CLIENTE		LEFT JOIN EMPRESA EMP ON EMP.CD_EMPRESA = C.ID_EMPRESA		LEFT JOIN COLABORADOR T on T.CD_COLABORADOR = C.CD_TECNICO_RESPONSAVEL		LEFT JOIN ROTA R on R.CD_ROTA = C.ID_ROTA		WHERE 1=1		AND C.FG_ATIVO = 1		AND C.CTRL_CENTRAL = 1  		GROUP BY C.ID_CENTRAL,GRUPO.nm_descricao, EMP.NM_RAZAO_SOCIAL) as r','SQL','5441',6000,6500,'verde','10/03/2023, 11:11:00',0,'DIRETORIA','http://45.225.191.101:9090/anywhere/#vfs://Global/Contas%20Ativas/Carteira%20Contas%20Ativas%20Sankhya.xview'),(6,'REINCIDENCIA O.S PORTARIA','REINCIDENCIA DE OS PORTARIA','declare @dtInicial datetime, @dtFinal datetime, @evento varchar(10), @csid varchar(10), @dtDiaMesAno date, @dtHora date, @tolerancia int; set @dtInicial = CURRENT_TIMESTAMP -30   set @dtFinal = CURRENT_TIMESTAMP  select TOP 1 MAX(c.ID_CENTRAL) as CSID ,COUNT(1) AS VALOR_NOTIFICACAO 	,max(c.FANTASIA) as FANTASIA 	, (T.NM_COLABORADOR)  AS ROTA_TECNICO_RESPONSAVEL 	,d.DESCRICAODEFEITO as DEFEITO from dbORDEM o inner join dbCENTRAL c on c.CD_CLIENTE = o.CD_CLIENTE LEFT JOIN COLABORADOR t on t.CD_COLABORADOR = o.ID_INSTALADOR LEFT JOIN OS_SOLICITANTE s on s.CD_OS_SOLICITANTE = o.CD_OS_SOLICITANTE LEFT JOIN OSDEFEITO d on d.IDOSDEFEITO = o.IDOSDEFEITO LEFT JOIN ROTA r on r.CD_ROTA = c.ID_ROTA LEFT JOIN dbBAIRRO br on br.ID_BAIRRO = c.ID_BAIRRO LEFT JOIN dbCIDADE CID on cid.ID_CIDADE = c.ID_CIDADE LEFT JOIN EMPRESA EMP ON EMP.CD_EMPRESA = C.ID_EMPRESA where 1 = 1 and ABERTURA between @dtInicial and @dtFinal and c.FG_ATIVO = 1  and c.CTRL_CENTRAL = 1 AND t.NM_COLABORADOR  IN (\'CPR 01 - RONALDO DIAS\',\'CPR 02 - FABIANO NEVES\',\'CPR 03 – RENAN PEREIRA\',\'CPR 04– EDUARDO BESSA\' ,\'CPR 06 - DANYEL\',\'CPR 10 - JAMES\',\'CPR 12 - RUBIAN\',\'CPR 24H – JONE WESLEY\',\'CPR 24H – DAVI\',\'CPR DEPARTAMENTO TÉCNICO TRIAGEM\')  group by  C.FANTASIA,T.NM_COLABORADOR,d.DESCRICAODEFEITO  order by COUNT(1)desc   ','SQL','32',50,100,'verde','10/03/2023, 11:11:00',0,'PORTARIA','http://45.225.191.101:9090/anywhere/#vfs://Global/Notifica%C3%A7%C3%B5es/Reicidencia%20Portaria%20GO.xview'),(7,'REINCIDENCIA O.S VAREJO','REINCIDENCIA DE OS VAREJO','declare @dtInicial datetime, @dtFinal datetime, @evento varchar(10), @csid varchar(10), @dtDiaMesAno date, @dtHora date, @tolerancia int; set @dtInicial = CURRENT_TIMESTAMP -30   set @dtFinal = CURRENT_TIMESTAMP  select TOP 1 MAX(c.ID_CENTRAL) as CSID ,COUNT(1) AS VALOR_NOTIFICACAO 	,max(c.FANTASIA) as FANTASIA 	, (T.NM_COLABORADOR)  AS ROTA_TECNICO_RESPONSAVEL 	,d.DESCRICAODEFEITO as DEFEITO from dbORDEM o inner join dbCENTRAL c on c.CD_CLIENTE = o.CD_CLIENTE LEFT JOIN COLABORADOR t on t.CD_COLABORADOR = o.ID_INSTALADOR LEFT JOIN OS_SOLICITANTE s on s.CD_OS_SOLICITANTE = o.CD_OS_SOLICITANTE LEFT JOIN OSDEFEITO d on d.IDOSDEFEITO = o.IDOSDEFEITO LEFT JOIN ROTA r on r.CD_ROTA = c.ID_ROTA LEFT JOIN dbBAIRRO br on br.ID_BAIRRO = c.ID_BAIRRO LEFT JOIN dbCIDADE CID on cid.ID_CIDADE = c.ID_CIDADE LEFT JOIN EMPRESA EMP ON EMP.CD_EMPRESA = C.ID_EMPRESA where 1 = 1 and ABERTURA between @dtInicial and @dtFinal and c.FG_ATIVO = 1  and c.CTRL_CENTRAL = 1  AND t.NM_COLABORADOR in (\'ROTA 03 - ROMERSON\',\'ROTA 06 - MARIO SERGIO\',\'ROTA 07 - JOAO FILHO\',\'ROTA 08 - LEVI\',\'ROTA 09 - Rodrigo Vieira\',\'ROTA 12 - ATILA VINICIUS\', \'ROTA 13 - CFTV VAREJO\') group by  C.FANTASIA,T.NM_COLABORADOR,d.DESCRICAODEFEITO  order by COUNT(1)desc   ','SQL','4',20,30,'verde','10/03/2023, 11:11:00',0,'VAREJO ','http://45.225.191.101:9090/anywhere/#vfs://Global/Notifica%C3%A7%C3%B5es/Reicidencia%20OS%20%20Varejo%20GO.xview'),(8,'REINCIDENCIA O.S CORPORATIVO','REINCIDENCIA DE OS CORPORATIVO','declare @dtInicial datetime, @dtFinal datetime, @evento varchar(10), @csid varchar(10), @dtDiaMesAno date, @dtHora date; set @dtInicial = CURRENT_TIMESTAMP -7 set @dtFinal = CURRENT_TIMESTAMP select TOP 1  CSID, COUNT(1) as VALOR_NOTIFICACAO, ( 	select max(fantasia) 	 from dbCENTRAL c 	 where 1=1 		and c.ID_EMPRESA = \'10040\'	 AND c.ID_CENTRAL = ev.csid) as Fantasia from  	( select c.ID_CENTRAL as CSID	from dbCENTRAL c 	inner join VIEW_HISTORICO h on h.CD_CLIENTE = c.CD_CLIENTE			LEFT JOIN dbEVENTCTID e ON e.ID_EVENTO = H.CD_EVENTO 		LEFT JOIN dbEVENTO z on z.CD_CLIENTE = c.CD_CLIENTE and z.ID_EVENTO = h.NU_AUXILIAR 		LEFT JOIN COLABORADOR t on t.CD_COLABORADOR = c.CD_TECNICO_RESPONSAVEL 		LEFT JOIN dbCIDADE CID on cid.ID_CIDADE = c.ID_CIDADE 		LEFT JOIN ROTA r on r.CD_ROTA = c.ID_ROTA 		LEFT JOIN dbBAIRRO br on br.ID_BAIRRO = c.ID_BAIRRO	where 1=1 		and c.FG_ATIVO = 1 		and c.CTRL_CENTRAL = 1   		and h.DT_RECEBIDO between @dtInicial and @dtFinal	 		and h.cd_evento in (\'1130\',\'1131\',\'1133\',\'1134\',\'E130\',\'E131\',\'E133\',\'E134\',\'E150\') 		and c.ID_EMPRESA = \'10040\' and (c.ID_ESTADO = \'SP\' or c.ID_ESTADO = \'RJ\' or c.ID_ESTADO = \'MG\' or c.ID_ESTADO = \'SC\' or c.ID_ESTADO = \'ES\')		 group by c.ID_CENTRAL, CONVERT(nvarchar,  h.DT_RECEBIDO, 3), t.NM_COLABORADOR, r.NM_ROTA) ev group by CSID order by COUNT(1) desc;','SQL','7',20,20,'verde','10/03/2023, 11:11:00',0,'COPORATIVO_BRA','http://45.225.191.101:9090/anywhere/#vfs://Global/Notifica%C3%A7%C3%B5es/Reicidencia%20Bradesco.xview'),(9,'BUFFER DE EVENTOS SIGMA ','BUFFER DE EVENTOS SIGMA ','SELECT COUNT(CD_RECEPCAO) AS VALOR_NOTIFICACAO FROM RECEPCAO','SQL','24',40,60,'verde','10/03/2023, 11:11:00',0,'SIGMA','https://noc.infomach.com.br:3000/d/b8_CM3x7z/newline-guests?orgId=1'),(10,'EVENTOS PENDENTES SIGMA','EVENTOS PENDENTES SIGMA','SELECT COUNT(CD_HISTORICO) AS VALOR_NOTIFICACAO FROM HISTORICO','SQL','538',1000,1200,'verde','10/03/2023, 11:11:00',0,'SIGMA','https://noc.infomach.com.br:3000/d/b8_CM3x7z/newline-guests?orgId=1'),(11,'O.S ATRASO CADASTRO','DESCRIÇÃO ORDEM DE SERVIÇO EM ATRASO SEGMENTO PORTARIA','declare @dtInicial datetime, @dtFinal datetime set @dtInicial = CURRENT_TIMESTAMP -30 set @dtFinal = CURRENT_TIMESTAMP SELECT top 1 c.ID_CENTRAL as CONTA ,c.FANTASIA ,t.NM_COLABORADOR as ROTA_TECNICO_RESPONSAVEL ,o.ID_ORDEM as NUM_OS ,CASE    WHEN o.FECHADO = 0 THEN \'ABERTO\'     WHEN o.FECHADO = 2 THEN \'EM EXECUÇÂO\'     WHEN o.FECHADO = 4 THEN \'AGUARDANDO FECHAMENTO\' END as _STATUS_O_S ,case when o.FECHADO = 1 then \'FECHADO\'  else convert(varchar,DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)) end as VALOR_NOTIFICACAO ,O.ABERTURA AS DATA_OS_ABERTA ,O.FECHAMENTO AS DATA_OS_FINALIZADA ,DATEDIFF(day,o.ABERTURA , o.FECHAMENTO) as TEMPO_ATENDIMENTO_DIAS ,o.DEFEITO as DEFEITO_DESCRICAO ,SOLU.DESCRICAOSOLUCAO as SOLUCAO ,o.EXECUTADO as INFORMACOES_ADICIONAIS ,EMP.NM_RAZAO_SOCIAL EMPRESA	,CASE	WHEN (EMP.NM_RAZAO_SOCIAL = \'CPR - CENTRAL DE PORTARIA REMOTA\' 		AND GRUPO.NM_DESCRICAO IN (\'NEW LINE - MATRIZ\', \'SEGZOOM\',\'CPR - CENTRAL DE PORTARIA REMO\')) THEN \'PORTARIA GO\' 		WHEN (EMP.NM_RAZAO_SOCIAL = \'BERÇÁRIO(PORTARIA REMOTA)\' AND GRUPO.NM_DESCRICAO IN (\'NEW LINE - MATRIZ\', \'SEGZOOM\',\'CPR - CENTRAL DE PORTARIA REMO\'))  		THEN \'BERCARIO GO\'		WHEN (EMP.NM_RAZAO_SOCIAL = \'BERÇÁRIO(PORTARIA REMOTA)\'AND GRUPO.NM_DESCRICAO IN (\'NEW LINE - ANAPOLIS\'))		THEN \'BERCARIO ANA\' 		WHEN (EMP.NM_RAZAO_SOCIAL = \'CPR - CENTRAL DE PORTARIA REMOTA\' AND GRUPO.NM_DESCRICAO IN (\'NEW LINE - ANAPOLIS\')) 			THEN \'PORTARIA ANA\' 		WHEN (EMP.NM_RAZAO_SOCIAL = \'BERÇÁRIO(PORTARIA REMOTA)\' AND grupo.NM_DESCRICAO IN (\'NEW LINE - TAGUATINGA\', \'NEW LINE RIACHO FUNDO - DF\'))		THEN \'BERCARIO DF\' 		WHEN (EMP.NM_RAZAO_SOCIAL = \'CPR - CENTRAL DE PORTARIA REMOTA\' 	AND grupo.NM_DESCRICAO IN (\'NEW LINE - TAGUATINGA\', \'NEW LINE RIACHO FUNDO - DF\')) 		THEN \'PORTARIA DF\' 		WHEN (EMP.NM_RAZAO_SOCIAL  IN(\'NEW LINE - BM ALARMES\',\'NEW LINE - DB COMERCIO\',\'NEW LINE - DL ALARMES\',\'CERCA SENSORIAL\') AND t.NM_COLABORADOR <> \'ROTA 507\') 		THEN \'VAREJO GO\'		WHEN t.NM_COLABORADOR = \'ROTA 507\'	THEN \'CORPORATIVO\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'Metropol Segurança\') THEN \'METROPOL ANA\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - TAGUATINGA NORTE\') THEN \'TAGUATINGA DF\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA DE GOIANIA\') THEN \'PREF-GOIANIA\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA APARECIDA DE GOIANIA\') THEN \'PREF-APARECIDA\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA DE MACAPA\',\'NEW LINE - MACAPA\') THEN \'MACAPA\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'BANCO BRADESCO\') THEN \'BRADESCO\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'BANPARA\') THEN \'BANPARA\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - BELEM\') THEN \'BELEM PA\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'SESMA\') THEN \'SESMA\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - MATRIZ\') THEN \'PREF-VIAMAO\'    ELSE EMP.NM_RAZAO_SOCIAL END AS SEGMENTO from dbORDEM O INNER JOIN dbCENTRAL C on C.CD_CLIENTE = o.CD_CLIENTE LEFT JOIN COLABORADOR T on T.CD_COLABORADOR = O.ID_INSTALADOR LEFT JOIN OSDEFEITO D on D.IDOSDEFEITO = O.IDOSDEFEITO LEFT JOIN dbBAIRRO BR on BR.ID_BAIRRO = C.ID_BAIRRO LEFT JOIN dbCIDADE CID on CID.ID_CIDADE = C.ID_CIDADE LEFT JOIN OSSOLUCAO SOLU on SOLU.IDOSSOLUCAO = O.IDOSSOLUCAO LEFT JOIN GRUPO_CLIENTE GRUPO on GRUPO.CD_GRUPO_CLIENTE = C.CD_GRUPO_CLIENTE LEFT JOIN EMPRESA EMP on EMP.CD_EMPRESA = C.ID_EMPRESA LEFT JOIN USUARIO U ON U.CD_COLABORADOR = T.CD_COLABORADOR WHERE 1 = 1 AND t.NM_COLABORADOR  IN (\'CPR 05 - CADASTRO\',\'CPR 19 - ADRIANO  OLIVEIRA - CADAS\',\'CPR 23 - SUZANA - CADASTRO\',\'CPR 20 - JOAO VICTOR - CADAS\',\'CPR 21 - AMAURI MACEDO - CADAS\') and EMP.NM_RAZAO_SOCIAL  not IN(\'NEW LINE - BM ALARMES\',\'NEW LINE - DB COMERCIO\',\'NEW LINE - DL ALARMES\',\'CERCA SENSORIAL\') and o.ABERTURA between @dtInicial and @dtFinal and d.IDOSDEFEITO not in (\'1054\',\'1081\',\'1002\',\'1064\',\'1009\',\'1033\',\'1034\') and convert(varchar,DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)) >3 and o.FECHADO in (\'0\',\'2\',\'4\') ORDER BY DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)   DESC','SQL','23',100,150,'verde','10/03/2023, 11:11:00',0,'CADASTRO','http://45.225.191.101:9090/anywhere/#vfs://Global/Notifica%C3%A7%C3%B5es/OS%20Em%20Atraso%20Cadastro.xview'),(12,'O.S VAREJO EM PAUSA','O.S VAREJO EM PAUSA','USE [902] declare @dtInicial datetime, @dtFinal datetime; set @dtInicial = CURRENT_TIMESTAMP -365 set @dtFinal = CURRENT_TIMESTAMP  SELECT c.ID_CENTRAL as CONTA,c.FANTASIA,t.NM_COLABORADOR as ROTA_TECNICO_RESPONSAVEL ,o.ID_ORDEM as NUM_OS,CASE WHEN o.FECHADO = 0 THEN \'ABERTO\'    WHEN o.FECHADO = 1 THEN \'FECHADO\'   WHEN o.FECHADO = 2 THEN \'EM EXECUÇÂO\'   WHEN o.FECHADO = 3 THEN \'EM PAUSA\'   WHEN o.FECHADO = 4 THEN \'AGUARDANDO FECHAMENTO\' END as _STATUS_O_S,case when o.FECHADO = 1 then \'FECHADO\'  else convert(varchar,DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)) end as RANKING ,case when o.FECHADO = 1 then \'FECHADO\'  else convert(varchar,DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)) end as VALOR_NOTIFICACAO ,case when o.FECHADO = 1 then \'FECHADO\'  else convert(varchar,DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)) end as DIAS_EM_ATRASO ,O.ABERTURA AS DATA_OS_ABERTA,DAY(o.ABERTURA) DIA_OS_ABERTA,O.TEMPOEXECUCAOPREVISTO as PREVISAO_HORAS,o.DATAAGENDADA ,S.NM_DESCRICAO as SOLICITANTE,D.DESCRICAODEFEITO as DEFEITO,o.DEFEITO as DEFEITO_DESCRICAO,o.EXECUTADO as INFORMACOES_ADICIONAIS ,GRUPO.NM_DESCRICAO as GRUPO,EMP.NM_RAZAO_SOCIAL EMPRESA,CASE	WHEN (EMP.NM_RAZAO_SOCIAL = \'CPR - CENTRAL DE PORTARIA REMOTA\' 		 AND GRUPO.NM_DESCRICAO IN (\'NEW LINE - MATRIZ\', \'SEGZOOM\',\'CPR - CENTRAL DE PORTARIA REMO\')) THEN \'PORTARIA GO\' 		WHEN (EMP.NM_RAZAO_SOCIAL = \'BERÇÁRIO(PORTARIA REMOTA)\'  AND GRUPO.NM_DESCRICAO IN (\'NEW LINE - MATRIZ\', \'SEGZOOM\',\'CPR - CENTRAL DE PORTARIA REMO\'))  THEN \'BERCARIO GO\'		WHEN (EMP.NM_RAZAO_SOCIAL = \'BERÇÁRIO(PORTARIA REMOTA)\' AND GRUPO.NM_DESCRICAO IN (\'NEW LINE - ANAPOLIS\')) THEN \'BERCARIO ANA\' WHEN (EMP.NM_RAZAO_SOCIAL = \'CPR - CENTRAL DE PORTARIA REMOTA\'  AND GRUPO.NM_DESCRICAO IN (\'NEW LINE - ANAPOLIS\')) 	THEN \'PORTARIA ANA\' WHEN (EMP.NM_RAZAO_SOCIAL = \'BERÇÁRIO(PORTARIA REMOTA)\' AND grupo.NM_DESCRICAO IN (\'NEW LINE - TAGUATINGA\', \'NEW LINE RIACHO FUNDO - DF\')) THEN \'BERCARIO DF\' WHEN (EMP.NM_RAZAO_SOCIAL = \'CPR - CENTRAL DE PORTARIA REMOTA\' 	AND grupo.NM_DESCRICAO IN (\'NEW LINE - TAGUATINGA\', \'NEW LINE RIACHO FUNDO - DF\')) THEN \'PORTARIA DF\' WHEN (EMP.NM_RAZAO_SOCIAL  IN(\'NEW LINE - BM ALARMES\',\'NEW LINE - DB COMERCIO\',\'NEW LINE - DL ALARMES\',\'CERCA SENSORIAL\') AND t.NM_COLABORADOR <> \'ROTA 507\') THEN \'VAREJO GO\'WHEN t.NM_COLABORADOR = \'ROTA 507\'	THEN \'CORPORATIVO\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'Metropol Segurança\') THEN \'METROPOL ANA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - TAGUATINGA NORTE\') THEN \'TAGUATINGA DF\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA DE GOIANIA\') THEN \'PREF-GOIANIA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA APARECIDA DE GOIANIA\') THEN \'PREF-APARECIDA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA DE MACAPA\',\'NEW LINE - MACAPA\') THEN \'MACAPA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'BANCO BRADESCO\') THEN \'BRADESCO\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'BANPARA\') THEN \'BANPARA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - BELEM\') THEN \'BELEM PA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'SESMA\') THEN \'SESMA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - MATRIZ\') THEN \'PREF-VIAMAO\'ELSE EMP.NM_RAZAO_SOCIAL END AS SEGMENTO from dbORDEM O INNER JOIN dbCENTRAL C on C.CD_CLIENTE = o.CD_CLIENTE LEFT JOIN COLABORADOR T on T.CD_COLABORADOR = O.ID_INSTALADOR LEFT JOIN OS_SOLICITANTE S on S.CD_OS_SOLICITANTE = o.CD_OS_SOLICITANTE LEFT JOIN OSDEFEITO D on D.IDOSDEFEITO = O.IDOSDEFEITO LEFT JOIN ROTA R on R.CD_ROTA = C.ID_ROTA LEFT JOIN dbBAIRRO BR on BR.ID_BAIRRO = C.ID_BAIRRO LEFT JOIN dbCIDADE CID on CID.ID_CIDADE = C.ID_CIDADE LEFT JOIN OSSOLUCAO SOLU on SOLU.IDOSSOLUCAO = O.IDOSSOLUCAO LEFT JOIN GRUPO_CLIENTE GRUPO on GRUPO.CD_GRUPO_CLIENTE = C.CD_GRUPO_CLIENTE LEFT JOIN EMPRESA EMP on EMP.CD_EMPRESA = C.ID_EMPRESA LEFT JOIN FORMA_PAGAMENTO PAG on PAG.CD_FORMA_PAGAMENTO = O.PAGAMENTO LEFT JOIN USUARIO U ON U.CD_COLABORADOR = T.CD_COLABORADOR WHERE 1 = 1  AND t.NM_COLABORADOR in ( \'ROTA 03 - ROMERSON\',\'ROTA 06 - MARIO SERGIO\',\'ROTA 07 - JOAO FILHO\',\'ROTA 08 - LEVI\',\'ROTA 09 - Rodrigo Vieira\',\'ROTA 12 - ATILA VINICIUS\',\'ROTA 13 - CFTV VAREJO\')  and o.FECHADO = \'3\' and o.IDOSDEFEITO <> \'1054\' AND DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP) > 3 ORDER BY DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)   desc','SQL','162',1000,1500,'verde','10/03/2023, 11:11:00',0,'VAREJO',NULL),(13,'O.S PORTARIA EM PAUSA ','O.S PORTARIA EM PAUSA ','USE [902] declare @dtInicial datetime, @dtFinal datetime;set @dtInicial = CURRENT_TIMESTAMP -365 set @dtFinal = CURRENT_TIMESTAMP SELECT top 1 c.ID_CENTRAL as CONTA,c.FANTASIA,t.NM_COLABORADOR as ROTA_TECNICO_RESPONSAVEL,o.ID_ORDEM as NUM_OS,CASE WHEN o.FECHADO = 0 THEN \'ABERTO\'    WHEN o.FECHADO = 1 THEN \'FECHADO\'   WHEN o.FECHADO = 2 THEN \'EM EXECUÇÂO\'   WHEN o.FECHADO = 3 THEN \'EM PAUSA\'  WHEN o.FECHADO = 4 THEN \'AGUARDANDO FECHAMENTO\'END as _S