IANIA\') THEN \'PREF-GOIANIA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA APARECIDA DE GOIANIA\') THEN \'PREF-APARECIDA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA DE MACAPA\',\'NEW LINE - MACAPA\') THEN \'MACAPA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'BANCO BRADESCO\') THEN \'BRADESCO\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'BANPARA\') THEN \'BANPARA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - BELEM\') THEN \'BELEM PA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'SESMA\') THEN \'SESMA\'WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - MATRIZ\') THEN \'PREF-VIAMAO\'ELSE EMP.NM_RAZAO_SOCIAL END AS SEGMENTO from dbORDEM O INNER JOIN dbCENTRAL C on C.CD_CLIENTE = o.CD_CLIENTE LEFT JOIN COLABORADOR T on T.CD_COLABORADOR = O.ID_INSTALADOR LEFT JOIN OS_SOLICITANTE S on S.CD_OS_SOLICITANTE = o.CD_OS_SOLICITANTE LEFT JOIN OSDEFEITO D on D.IDOSDEFEITO = O.IDOSDEFEITO LEFT JOIN ROTA R on R.CD_ROTA = C.ID_ROTA LEFT JOIN dbBAIRRO BR on BR.ID_BAIRRO = C.ID_BAIRRO LEFT JOIN dbCIDADE CID on CID.ID_CIDADE = C.ID_CIDADE LEFT JOIN OSSOLUCAO SOLU on SOLU.IDOSSOLUCAO = O.IDOSSOLUCAO LEFT JOIN GRUPO_CLIENTE GRUPO on GRUPO.CD_GRUPO_CLIENTE = C.CD_GRUPO_CLIENTE LEFT JOIN EMPRESA EMP on EMP.CD_EMPRESA = C.ID_EMPRESA LEFT JOIN FORMA_PAGAMENTO PAG on PAG.CD_FORMA_PAGAMENTO = O.PAGAMENTO LEFT JOIN USUARIO U ON U.CD_COLABORADOR = T.CD_COLABORADOR WHERE 1 = 1 AND t.NM_COLABORADOR  IN (\'CPR 01 - RONALDO DIAS\',\'CPR 02 - FABIANO NEVES\',\'CPR 03 – RENAN PEREIRA\',\'CPR 04– EDUARDO BESSA\' ,\'CPR 06 - DANYEL\',\'CPR 10 - JAMES\',\'CPR 12 - RUBIAN\',\'CPR 24H – JONE WESLEY\',\'CPR 24H – DAVI\',\'CPR DEPARTAMENTO TÉCNICO TRIAGEM\',\'CPR 09 – JHONNATHAN ROBERT\') and o.FECHADO = \'3\' and o.IDOSDEFEITO <> \'1054\' AND DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP) > 3 ORDER BY DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)   desc','SQL','15',1000,1500,'verde','10/03/2023, 11:11:00',0,'PORTIA',NULL),(14,'O.S CADASTRO EM PAUSA ','O.S CADASTRO EM PAUSA ','declare @dtInicial datetime, @dtFinal datetime set @dtInicial = CURRENT_TIMESTAMP -365 set @dtFinal 