l Segurança\') THEN \'METROPOL ANA\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - TAGUATINGA NORTE\') THEN \'TAGUATINGA DF\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA DE GOIANIA\') THEN \'PREF-GOIANIA\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA APARECIDA DE GOIANIA\') THEN \'PREF-APARECIDA\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'PREFEITURA DE MACAPA\',\'NEW LINE - MACAPA\') THEN \'MACAPA\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'BANCO BRADESCO\') THEN \'BRADESCO\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'BANPARA\') THEN \'BANPARA\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - BELEM\') THEN \'BELEM PA\'		WHEN EMP.NM_RAZAO_SOCIAL IN(\'SESMA\') THEN \'SESMA\' WHEN EMP.NM_RAZAO_SOCIAL IN(\'NEW LINE - MATRIZ\') THEN \'PREF-VIAMAO\'    ELSE EMP.NM_RAZAO_SOCIAL END AS SEGMENTO from dbORDEM O INNER JOIN dbCENTRAL C on C.CD_CLIENTE = o.CD_CLIENTE LEFT JOIN COLABORADOR T on T.CD_COLABORADOR = O.ID_INSTALADOR LEFT JOIN OSDEFEITO D on D.IDOSDEFEITO = O.IDOSDEFEITO LEFT JOIN dbBAIRRO BR on BR.ID_BAIRRO = C.ID_BAIRRO LEFT JOIN dbCIDADE CID on CID.ID_CIDADE = C.ID_CIDADE LEFT JOIN OSSOLUCAO SOLU on SOLU.IDOSSOLUCAO = O.IDOSSOLUCAO LEFT JOIN GRUPO_CLIENTE GRUPO on GRUPO.CD_GRUPO_CLIENTE = C.CD_GRUPO_CLIENTE LEFT JOIN EMPRESA EMP on EMP.CD_EMPRESA = C.ID_EMPRESA LEFT JOIN USUARIO U ON U.CD_COLABORADOR = T.CD_COLABORADOR WHERE 1 = 1  AND t.NM_COLABORADOR  IN (\'CPR 05 - CADASTRO\',\'CPR 19 - ADRIANO  OLIVEIRA - CADAS\',\'CPR 23 - SUZANA - CADASTRO\',\'CPR 20 - JOAO VICTOR - CADAS\',\'CPR 21 - AMAURI MACEDO - CADAS\')  and EMP.NM_RAZAO_SOCIAL  not IN(\'NEW LINE - BM ALARMES\',\'NEW LINE - DB COMERCIO\',\'NEW LINE - DL ALARMES\',\'CERCA SENSORIAL\')  and o.ABERTURA between @dtInicial and @dtFinal  and d.IDOSDEFEITO  = 1054 and DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)>3  and o.FECHADO = 3 ORDER BY DATEDIFF(day,o.ABERTURA , CURRENT_TIMESTAMP)   DESC','SQL','50',1000,1520,'verde','10/03/2023, 11:11:00',0,'CADASTRO',NULL);
